import Image from 'react-bootstrap/Image';

function BmtLogo() {
  const bmtLogo = require('./images/bmt-micro-logo-full.png');

  return (
    <section>
      <img
        src={bmtLogo}
      />
    </section>
  );
}

export default BmtLogo;
